import React from 'react';
import './Testimonial.css';

function Testimonial({ quote, author, role }) {
  return (
    <div className="testimonial">
      <p>"{quote}"</p>
      <h4>{author}</h4>
      <p className="role">{role}</p>
    </div>
  );
}

export default Testimonial;
